                      });
                    }}
                  >
                    <Option value="ComboBox">ComboBox</Option>
                    <Option value="Altro">Altro</Option>
                  </Select>
                </Col>
              </Row>
            </div>
            <br></br>
            <p></p>
            <div>
              <Row>
                <Col span={6}>Giorni da ultimo acquisto</Col>
                <Col span={6}>Giorno da ultimo accesso in negozio</Col>
                <Col span={6}>Giorni da ultimo accesso online</Col>
              </Row>
              <br></br>

              <div>
                <Row>
                  <Col span={6}>
                    <Select
                      value={dataForm.StepUtente.UltimoAcquisto}
                      name="UltimoAcquisto"
                      defaultValue="ComboBox"
                      style={{ width: 160 }}
                      onChange={value => {
                        setDataForm({
                          ...dataForm,
                          StepUtente: {
                            ...StepUtente,
                            UltimoAcquisto: value
                          }
                        });
                      }}
                    >
                      <Option value="ComboBox">ComboBox</Option>
                      <Option value="Altro">Altro</Option>
                    </Select>
                  </Col>
                  <Col span={6}>
                    <Select
                      value={dataForm.StepUtente.AccessoNegozio}
                      name="AccessoNegozio"
                      defaultValue="ComboBox"
                      style={{ width: 160 }}
                      onChange={value => {
                        setDataForm({
                          ...dataForm,
                          StepUtente: {
                            ...StepUtente,
                            AccessoNegozio: value
                          }
                        });
                      }}
                    >
                      <Option value="ComboBox">ComboBox</Option>
                      <Option value="Altro">Altro</Option>
                    </Select>
                  </Col>
                  <Col span={6}>
                    <Select
                      value={dataForm.StepUtente.AccessoOnline}
                      name="AccessoOnline"
                      defaultValue="ComboBox"
                      style={{ width: 160 }}
                      onChange={value => {
                        setDataForm({
                          ...dataForm,
                          StepUtente: {
                            ...StepUtente,
                            AccessoOnline: value
                          }
                        });
                      }}
                    >
                      <Option value="ComboBox">ComboBox</Option>
                      <Option value="Altro">Altro</Option>
                    </Select>
                  </Col>
                </Row>
              </div>
            </div>
            <div>
              <br></br>
              <p></p>
              <Row>
                <Col span={6}>Fascia importo acquisto medio</Col>
              </Row>
              <br></br>

              <div>
                <Row>
                  <Col span={6}>
                    <Select
                      value={dataForm.StepUtente.FasciaImporto}
                      name="FasciaImporto"
                      defaultValue="ComboBox"
                      style={{ width: 160 }}
                      onChange={value => {
                        setDataForm({
                          ...dataForm,
                          StepUtente: {
                            ...StepUtente,
                            FasciaImporto: value
                          }
                        });
                      }}
                    >
                      <Option value="ComboBox">ComboBox</Option>
                      <Option value="Altro">Altro</Option>
                    </Select>
                  </Col>
                </Row>
              </div>
            </div>
          </Card>
          <div>
            <Card title="Negozio Favorito" style={{ width: 1600 }}>
              <div>
                <Row>
                  <Col span={6}>
                    <Radio.Group
                      value={dataForm.StepUtente.Negozio}
                      name="Negozio"
                      defaultValue="Italia"
                      options={option}
                      onChange={value => {
                        setDataForm({
                          ...dataForm,
                          StepUtente: {
                            ...StepUtente,
                            Negozio: value.target.value
                          }
                        });
                      }}
                    ></Radio.Group>
                  </Col>
                </Row>
                <br></br>
                <p></p>
                <div>
                  <Row>
                    <Col span={6}>Nazione</Col>
                    <Col span={6}>Tipologia POS</Col>
                    <Col span={6}>POS</Col>
                  </Row>
                </div>
                <br></br>
                <div>
                  <Row>
                    <Col span={6}>
                      <Select
                        value={dataForm.StepUtente.NazioneNegozio}
                        name="NazioneNegozio"
                        defaultValue="Italia"
                        style={{ width: 160 }}
                        onChange={value => {
                          setDataForm({
                            ...dataForm,
                            StepUtente: {
                              ...StepUtente,
                              Nazione: value
                            }
                          });
                        }}
                      >
                        <Option value="Italia">Italia</Option>
                        <Option value="Altro">Altro</Option>
                      </Select>
